create table deposit_certificate
(
    id                 bigint auto_increment
        primary key,
    certificate_name   varchar(255)           null comment '存证名称',
    certificate_role   varchar(32)            null comment '存证角色',
    certificate_logo   bigint                 null comment '存证logo',
    user_id            bigint                 null comment '用户id',
    specification      varchar(64)            null comment '产品规格',
    case_number        varchar(32)            null comment '产品箱号',
    batch_number       varchar(64)            null comment '产品批次号',
    amount             bigint                 null comment '产品数量',
    purchasing_company varchar(255)           null comment '采购企业',
    product_name       varchar(255)           null comment '产品名称',
    create_time        datetime               null,
    create_by          varchar(32)            null,
    update_time        datetime               null,
    update_by          varchar(32)            null,
    audit_time         datetime               null comment '审核时间',
    hasd_value         varchar(255)           null comment '哈希值',
    block_height       varchar(255)           null comment '区块高度',
    template_id        bigint                 null comment '模板ID',
    appli_time         datetime               null comment '申请时间',
    on_chain_status    tinyint(1) default 1   null comment '上链转态1:未上链  2：已上链 3：上链中 4：上链失败 5:申请上链',
    on_chain_time      datetime               null comment '上链时间',
    audit_remark       varchar(255)           null comment '审核备注',
    audit_status       tinyint(1)             null comment '审核状态 1：上链  2：拒绝',
    audit_by           varchar(32)            null comment '审核人',
    parameter          text                   null comment '扩充参数',
    is_send            varchar(2) default 'N' null comment '是否已发送',
    send_time          datetime               null comment '发送时间',
    certificate        varchar(255)           null comment '存证证书url',
    fragrance          varchar(64)            null comment '香型',
    degree             varchar(64)            null comment '度数',
    capacity           varchar(64)            null comment '容量'
);

create index index_user_id
    on deposit_certificate (user_id);

